/* eslint no-unused-vars: 0 */
import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<a class="ui5-link-root" role="${ifDefined(context.effectiveAccRole)}" href="${ifDefined(context.parsedRef)}" target="${ifDefined(context.target)}" rel="${ifDefined(context._rel)}" tabindex="${ifDefined(context.tabIndex)}" ?disabled="${context.disabled}" aria-label="${ifDefined(context.ariaLabelText)}" aria-haspopup="${ifDefined(context.ariaHaspopup)}" @focusin=${context._onfocusin} @focusout=${context._onfocusout} @click=${context._onclick} @keydown=${context._onkeydown} @keyup=${context._onkeyup}><slot></slot>${ context.hasLinkType ? block1(context) : undefined }</a>`; };
const block1 = (context) => { return html`<span class="ui5-hidden-text">${ifDefined(context.linkTypeText)}</span>`; };


	return block0(context);
};

export default main;
